    public static boolean searchMatrix(int[][] matrix, int target) {
        if (matrix.length == 0){
            return false;
        }
        int[] targetA = null;
        for (int i = 0; i < matrix.length; i++) {
            if (matrix[i].length == 0){
                return false;
            }
            int[] matrix1 = matrix[i];
            if (matrix1[matrix1.length-1] >= target ){
                targetA = matrix1;
                break;
            }
            continue;
        }
        if (targetA == null){
            return false;
        }
        for (int i = 0; i < targetA.length; i++) {
            if (targetA[i] == target){
                return true;
            }
        }

        return false;
    }


    public static int romanToInt(String s) {
        HashMap map = new HashMap<>();
        map.put('I', 1);
        map.put('V', 5);
        map.put('X', 10);
        map.put('L', 50);
        map.put('C', 100);
        map.put('D', 500);
        map.put('M', 1000);
        int[] r = new int[s.getBytes().length];
        for (int i = 0; i < s.getBytes().length; i++){
            char c = s.charAt(i);
            r[i] = (int) map.get(c);
        }
        int tem = 0;
        for (int i = 0; i < r.length; i++){
            if (i == r.length-1 || r[i] >= r[i + 1]){
                tem += r[i];
            } else {
                tem += r[i + 1]-r[i];
                i++;
            }

        }
        return tem;
    }

    /**
     * 初始位置 (0, 0) 处有一个机器人。给出它的一系列动作，判断这个机器人的移动路线是否形成一个圆圈，换言之就是判断它是否会移回到原来的位置。

     移动顺序由一个字符串表示。每一个动作都是由一个字符来表示的。机器人有效的动作有 R（右），L（左），U（上）和 D（下）。输出应为 true 或 false，表示机器人移动路线是否成圈。
     * @param moves
     * @return
     */
    public static boolean judgeCircle(String moves) {
        Integer rl = 0;
        Integer ud = 0;
        for (int i = 0; i < moves.getBytes().length; i++) {
            char c = moves.charAt(i);
            if ('R' == c){
                rl++;
            }
            if ('L' == c){
                rl--;
            }
            if ('U' == c){
                ++ud;
            }
            if ('D' == c){
                --ud;
            }
        }
        if (rl != 0 ||ud != 0)
            return false;
        return true;
    }

    /**
     * 给定一个整数数组和一个目标值，找出数组中和为目标值的两个数。
     你可以假设每个输入只对应一种答案，且同样的元素不能被重复利用。
     * @param nums
     * @param target
     * @return
     */
    public static int[] twoSum(int[] nums, int target) {

        int[] result = new int[2];

        for (int m = 0; m < nums.length; m++) {
            int first = nums[m];
            for (int n = m+1; n < nums.length; n++) {
                int second = nums[n];
                if (first + second == target){
                    result[0] = m;
                    result[1] = n;
                    return result;
                }
            }
        }

        return null;
    }
